import React, { useEffect, useState } from 'react';

function App() {
  const [message, setMessage] = useState('');

  useEffect(() => {
    fetch('/api/message')
        .then((response) => response.json())
        .then((data) => setMessage(data.message));
  }, []);

  return (
      <div>
        <h1>React + Express</h1>
        <p>{message || 'Loading...'}</p>
      </div>
  );
}

export default App;
